import React from "react";
import NewProduct from "../home/NewProduct";
import BestSeller from '../home/BestSeller'
const Home = () => {
  return (

    <div>
      <div class="glide" id="glide1"><div class="glide__track" data-glide-el="track"><ul class="glide__slides vert-hero-banner-container"><li class="glide__slide vert-hero-banner" onclick="ga('send', 'event', 'Vertical Home - Pharmacies Chat', 'Click', 'heroCarousel - Medicine Delivery Hero')"><a href="https://hd.co.th/initiate-regular-pharmacy-chat"><img style="box-shadow: 0px 0px 0px 0px #ffffff !important;" src=" https://static.hd.co.th/system/image_attachments/images/000/153/667/original/desktop-_herobanner-pharma.jpg " alt="Medicine Delivery Hero"/></a></li></ul></div></div>
      {/* New Product */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้ามาใหม่
       </h4>
         <NewProduct />   





      {/* Best Seller */}
      <h4 
      className="text-center p-3 mt-5 mb-5 display-4 jumbotron">
          สินค้าขายอย่างดี
       </h4>
        <BestSeller />

    </div>
  );
};

export default Home;
